webpackJsonp([0x6e6ecf6e67c3],{1148:function(t,e){t.exports={data:{site:{siteMetadata:{title:"Psyked.co.uk",author:"James Ford"}},markdownRemark:{id:"/Users/James/Repositories/portfolio-2018/src/posts/experiments-with-html5-geolocation/index.md absPath of file >>> MarkdownRemark",html:'<p>[\n  <a\n    class="gatsby-resp-image-link"\n    href="/portfolio-2018/static/geolocation-6d6498139c118289830781faeffa9286-41a8d.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 55.99999999999999%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="geolocation"\n        title=""\n        src="/portfolio-2018/static/geolocation-6d6498139c118289830781faeffa9286-41a8d.png"\n        srcset="/portfolio-2018/static/geolocation-6d6498139c118289830781faeffa9286-bf474.png 158w,\n/portfolio-2018/static/geolocation-6d6498139c118289830781faeffa9286-d5dd3.png 315w,\n/portfolio-2018/static/geolocation-6d6498139c118289830781faeffa9286-41a8d.png 500w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>I\'ve been exploring the <a href="http://www.w3.org/TR/geolocation-API/" title="Open the W3C specification for Geolocation">HTML5 Geolocation specification</a> recently, and it\'s both fascinating and a little scary how accurate your browsers\' Geolocation capabilities have become, especially if you\'re working on a machine with Wifi capabilities.</p>\n<p>Inspired by this, I thought it would be cool to come up with some elaborate UAV interface mockup in HTML5 (so that it would work on iOS devices) and throw some cool stats in there.</p>\n<p>As it turns out, I get bored too quickly and never finished these experiments, but my <a href="http://www.psyked.co.uk/geolocation/">initial prototypes are available here</a>. Sans explanation and documentation, of course.</p>',frontmatter:{title:"Experiments with HTML5 Geolocation",date:"April 12, 2011",tags:["html5","geolocation"],url:null}}},pathContext:{prev:{frontmatter:{path:"/blog/explorative-prototyping-71f2ad9d4e41/",tags:["Hackathon","Prototyping","Programming"],title:"Explorative Prototyping",image:"https://cdn-images-1.medium.com/max/1200/1*t-PnNMQ78_vCBb4t1MA0Iw.png",date:"2016-05-17T19:48:34.316Z"}},next:{frontmatter:{path:"/blog/exempli-gratia-using-tweener/",tags:["flash","actionscript","animation","google-code","open-source"],title:"Exempli Gratia : Using Tweener",image:null,date:"2008-07-18T18:53:31.000Z"}}}}}});
